{{
(function() {
	const selectedRow = smsTable.selectedRow
	const smsRegex = selectedRow.smsRegex
	const sampleSms = selectedRow.sampleSms.replace(/\(|\)|,|!|'|"/g, '').replace(/[\t\n\r]/gm,' ').replace(/  +/g, ' ').split(' ').join(' ')
	const rgxp = new RegExp(smsRegex)
	const parts = rgxp.exec(sampleSms)
	if (!parts) {
		return `${smsRegex} \r\n${sampleSms}`
	}
	parts.shift()
return `${selectedRow.sampleSms} \r\n\n${selectedRow.smsRegex}\r\n\n ${
parts.map((p,ix) => `${selectedRow[`mc${ix+1}`]} : ${p} \r\n`)
}\r\n${selectedRow.dateFormats}\r\n ${selectedRow.transactionType} \r\n${selectedRow.accountType}\r\n${selectedRow.messageType}`
})()
}}
